import React from 'react';

const Popup = () => {
  return (
    <div className="w-[300px] h-[400px] bg-white text-gray-900 p-4 shadow-lg rounded-lg">
      <h1 className="text-xl font-bold mb-2 text-center">Zenly AI Therapist</h1>
      <p className="text-sm mb-4 text-center">
        Your personal mental wellness companion.
      </p>

      <div className="flex flex-col space-y-3">
        <button className="bg-blue-600 hover:bg-blue-700 text-white font-semibold py-2 px-4 rounded transition duration-200">
          Start Chat
        </button>

        <button className="bg-green-500 hover:bg-green-600 text-white font-semibold py-2 px-4 rounded transition duration-200">
          Mood Tracker
        </button>

        <button className="bg-gray-200 hover:bg-gray-300 text-gray-700 py-2 px-4 rounded transition duration-200">
          Settings
        </button>
      </div>

      <div className="mt-6 text-center text-xs text-gray-500">
        &copy; 2025 Zenly.ai
      </div>
    </div>
  );
};

export default Popup;
